<p>As you know, we check only the DAY and MONTH to see if the birthday is between START and END for a birthday and ignore the year.</p>
<p>for example, the birthday is 1990-05-02 (yyyy-mm-dd)
and we should find it in the range of 2023-01-01 till 2023-06-01
