Different ways to remove Object from array using mongoose<p>Title. I noticed that there are two (maybe more) ways to remove a specific object from an array in a document. Example schema:</p>
<pre><code>var diveSchema = new Schema({
//irrelevant fields
    divers: [{
        user: { type: Schema.Types.ObjectId, ref: 'User', required: true },
        meetingLocation: { type: String, enum: ['carpool', 'onSite'], required: true },
        dives: Number,
        exercise: { type: Schema.Types.ObjectId, ref: 'Exercise' },
    }]
});
</code></pre>
<p>For example, <a href="https://stackoverflow.com/a/40588927/13062745">here they used $pull syntax</a></p>
<pre><code>Dive.update({ _id: diveId }, { &quot;$pull&quot;: { &quot;divers&quot;: { &quot;user&quot;: userIdToRemove } }}, { safe: true, multi:true }, function(err, obj) {
    //do something smart
});
</code></pre>
<p>to remove a matching object. But sometimes, this is used</p>
<pre><code>let dive = await Dive.findById(diveId)
dive.drivers = dive.drivers.filter(driver =&gt; driver.user.toString() !=== userIdToRemove);
await dive.save();
</code></pre>
<p>Which one is better and recommended?</p>

