Change stream not triggering with specific pipeline in MongoDB<p>I'm working on a project where I need to watch for changes in MongoDB documents for groups that a user manages. I'm using change streams in MongoDB to accomplish this. However, I'm facing an issue where the change stream is not triggering when I use a specific pipeline to match documents based on the manager's user ID. I'd like to understand why the change stream is not working as expected and how to fix it.</p>
<pre><code>    public ManagerGroupWatch = (user_id: string) =&gt; {
      const pipeline = [{ $match: { 'manager.user_id': user_id } }];
      const changeStream = GroupModel.watch(pipeline);
      changeStream.on('change', (change) =&gt; {
          // Handle the change event
          console.log('Change:', change);
       });

    }
</code></pre>
<p>Document example:</p>
<pre><code>_id: 'TEST'
name: &quot;test&quot;
entry_coins: 100
uuid: &quot;**********&quot;
group_created: 2023-05-15T11:41:39.369+00:00
participants: Array
tournament: Object
manager: {user_id:'some_id', name:'test'}
current_match: Object
total_amount_win: 300
picture: &quot;&quot;
slug: &quot;test-test&quot;
history_matches: Array
requestsJoins: Array
__v: 4
</code></pre>
<p>The issue I'm facing is that the change stream is not triggering when I use the pipeline to match documents based on the manager's user ID. However, if I remove the pipeline and watch for all documents, the change stream works fine. I've verified that the documents indeed have the correct manager's user ID. I'm not sure why the change stream is not working with the specific pipeline.</p>
<p>I would appreciate any insights or suggestions on how to resolve this issue. Thank you in advance!</p>

