<pre><code>//FlashCardSchema
const flashcardSchema = new Schema({
    deckID: { type: Schema.Types.ObjectId, required: true },
    side1: { type: String, required: true },
    side2: { type: String, required: true }
}, { collection: &quot;Flashcards&quot; })

//FlashCardSetSchema
const flashcardDeckSchema = new Schema({
    collectionID: { type: Schema.Types.ObjectId, required: true },
    setTitle: { type: String, required: true },
    flashcards: [flashcardSchema]
}, { collection: &quot;Decks&quot; });

//FlashCard DB Schemas
const flashcardCollectionSchema = new Schema({
    userID: {
        type: Schema.Types.ObjectId,
        required: true
    },
    decks: [flashcardDeckSchema]
}, { collection: &quot;FlashcardCollection&quot; });
</code></pre>
<p>As you can see a flashcard collection is also connected to a user collection through its auto generated ID by mongodb. This means each user has only one &quot;flashcardcollection&quot; which is generated the same time a user registers.</p>
<p>Currently I am working on the login page and since this project is working with RESTApis I am using JWT tokens for login/authorization, and within these tokens I am passing on information such as UserID.</p>
<p>What I am trying to do currently is when someone tries to login, it verifies them, and finds the flashcardcollection assigned to them based on their userID. I ran into a problem of trying to call a findOne function within another findOne function and therefore I am not progressing.</p>
<p>Currently the login code looks as the following:</p>
<pre><code>//Request email, password -&gt; find user with email -&gt; if no user throw error -&gt; get password -&gt; decrypt and compare -&gt; if false throw error -&gt; if true generate JWT token
//JWT secret == JWTSECRETKEY , Expires in 1 hour
exports.login = async (req, res, next) =&gt; {
    const email = req.body.email;
    const password = req.body.password;
    let loadedUser;
    let loadedFlashcardCollection;


    User.findOne({ email: email }).then(user =&gt; {
        if (!user) {
            const error = new Error('A user with this email does not exist');
            error.statusCode = 401;
            throw error;
        }
        loadedUser = user;
        return bcrypt.compare(password, user.password);
    })
        .then(isEqual =&gt; {
            if (!isEqual) {
                const error = new Error(&quot;Wrong Password&quot;);
                error.statusCode = 401;
                throw error;
            }
            loadedFlashcardCollection = getCollectionId(loadedUser._id);
            //Error caused by trying to insert flashcardID into  JWT token and not being able to get a respons
            const token = jwt.sign({ email: loadedUser.email, userId: loadedUser._id.toString(), loadedFlashcardCollection: loadedFlashcardCollection.toString() }, 'JWTSECRETTOKEN', { expiresIn: '2h' });
            res.status(200).json({ token: token, userId: loadedUser._id.toString(), collectionID: loadedFlashcardCollection.toString() })
        })
        .catch(err =&gt; {
            if (!err.statusCode) {
                err.statusCode = 500;
            }
            next(err);
        })
}



//function to find userID async way since it was needed.
async function getCollectionId(loadedUserID) {
    const collection = await flashcardCollection.findOne({ userID: loadedUserID });
    if (!collection) {
        error.statusCode = 401;
        throw new Error(`No collection found.`);
    }
    return collection._id;
}
</code></pre>
